window.editPresetModal = function(name) {
	const preset = presets[name];
	if (!preset) return;
	// 既存モーダル削除
	const old = document.getElementById('presetEditModal');
	if (old) old.remove();
	if (!document.getElementById('jpModalAnimStyle')) {
		const style = document.createElement('style');
		style.id = 'jpModalAnimStyle';
		// アニメーションを無効化
			   // style.textContent = ``;
		document.head.appendChild(style);
	}
	const modal = document.createElement('div');
	modal.id = 'presetEditModal';
	modal.style.position = 'fixed';
	modal.style.top = '0';
	modal.style.left = '0';
	modal.style.width = '100vw';
	modal.style.height = '100vh';
	modal.style.background = 'transparent';
	modal.style.zIndex = '9999';
	modal.style.display = 'flex';
	modal.style.alignItems = 'center';
	modal.style.justifyContent = 'center';
	modal.innerHTML = `<div style='background:#222;padding:32px;border-radius:8px;width:350px;max-width:90vw;'>
	<div style='font-size:1.1em;margin-bottom:8px;color:#fff;'>プリセット名の編集</div>
	<input type='text' id='editPresetNameInput' value='${name}' style='width:100%;margin-bottom:12px;padding:8px;background:#444;border:none;color:#fff;border-radius:4px;'>
	<button id='editPresetSaveBtn' class='btn' style='width:100%;margin-bottom:8px;'>保存</button>
	<button id='editPresetCancelBtn' class='btn' style='width:100%;background:#555;'>キャンセル</button>
	</div>`;
	document.body.appendChild(modal);
	document.getElementById('editPresetNameInput').focus();
	document.getElementById('editPresetSaveBtn').onclick = function() {
		const newName = document.getElementById('editPresetNameInput').value.trim();
		if (!newName) {
			showToast('プリセット名を入力してください', true);
			return;
		}
		if (newName !== name && presets[newName]) {
			showToast('同じ名前のプリセットが既に存在します', true);
			return;
		}
		// 名前変更
		if (newName !== name) {
			presets[newName] = {...preset, createdAt: preset.createdAt};
			delete presets[name];
		}
		savePresetsToLocalStorage();
		renderPresetList();
		showToast('プリセット名を変更しました');
		modal.remove();
	};
	document.getElementById('editPresetCancelBtn').onclick = function() {
		modal.remove();
	};
	document.getElementById('editPresetNameInput').addEventListener('keypress', function(e) {
		if (e.key === 'Enter') document.getElementById('editPresetSaveBtn').click();
	});
}
