	function renderColorGradientList() {
		const list = document.getElementById('colorGradientList');
		const colors = colorGradients[currentColorType];
		
		list.innerHTML = '';
		
		// 角度スライダー（背景以外も表示）
		const parent = list.parentElement;
		const oldSlider = parent.querySelector('#angleSlider');
		if (oldSlider) {
			const oldDiv = oldSlider.closest('div');
			if (oldDiv) oldDiv.remove();
		}
		
		if (colors.length > 1 || currentColorType === 'bg') {
			const angleDiv = document.createElement('div');
			angleDiv.style.display = 'flex';
			angleDiv.style.alignItems = 'center';
			angleDiv.style.marginBottom = '12px';
			const currentAngle = colorAngles[currentColorType];
			angleDiv.innerHTML = `
				<span style='color:#fff;font-size:1em;margin-right:8px;'>角度：</span>
				<input type='range' min='0' max='360' value='${currentAngle}' id='angleSlider' style='flex:1;'>
				<span style='color:#fff;margin-left:8px;'>${currentAngle}°</span>
			`;
			parent.insertBefore(angleDiv, list);
			setTimeout(() => {
				document.getElementById('angleSlider').oninput = function(e) {
					colorAngles[currentColorType] = parseInt(e.target.value);
					angleDiv.querySelector('span:last-child').textContent = `${colorAngles[currentColorType]}°`;
					updateColorBar(currentColorType);
					drawFrame();
				};
			}, 0);
		}
		
		   colors.forEach((colorItem, i) => {
			   const div = document.createElement('div');
			   div.className = 'color-gradient-item';
			   div.setAttribute('draggable', 'true');
			   div.dataset.index = i;
			   div.innerHTML = `
				   <div class="color-drag-handle"><i class="fa fa-grip-vertical"></i></div>
				   <div class="color-item-preview" style="background: ${colorItem.color};"></div>
				   <input type="color" class="color-item-input" value="${colorItem.color}" onchange="updateColorItem(${i}, this.value)">
				   ${colors.length > 1 ? `<button class="color-delete-btn" onclick="deleteColorItem(${i})">削除</button>` : ''}
			   `;
			   // 色変更をリアルタイムで反映
			   const colorInput = div.querySelector('.color-item-input');
			   const colorPreview = div.querySelector('.color-item-preview');
			   colorInput.addEventListener('input', function(e) {
				   window.updateColorItem(i, e.target.value);
				   colorPreview.style.background = e.target.value;
			   });
			   // ドラッグ＆ドロップイベント
			   div.addEventListener('dragstart', function(e) {
				   e.dataTransfer.effectAllowed = 'move';
				   e.dataTransfer.setData('text/plain', i);
				   div.classList.add('dragging');
			   });
			   div.addEventListener('dragend', function(e) {
				   div.classList.remove('dragging');
				   document.querySelectorAll('.color-gradient-item.drag-over').forEach(el => el.classList.remove('drag-over'));
			   });
			   div.addEventListener('dragover', function(e) {
				   e.preventDefault();
				   e.dataTransfer.dropEffect = 'move';
				   document.querySelectorAll('.color-gradient-item.drag-over').forEach(el => el.classList.remove('drag-over'));
				   // ドラッグ中の要素自身にはdrag-overを付与しない
				   if (!div.classList.contains('dragging')) {
					   div.classList.add('drag-over');
				   }
			   });
			   div.addEventListener('dragleave', function(e) {
				   div.classList.remove('drag-over');
			   });
			   div.addEventListener('drop', function(e) {
				   e.preventDefault();
				   const from = parseInt(e.dataTransfer.getData('text/plain'));
				   const to = i;
				   if (from !== to) {
					   const arr = colorGradients[currentColorType];
					   const moved = arr.splice(from, 1)[0];
					   arr.splice(to, 0, moved);
					   renderColorGradientList();
					   updateColorBar(currentColorType);
				   }
				   div.classList.remove('drag-over');
			   });
			   list.appendChild(div);
		   });
	}

