	function updateColorBar(type) {
		const colors = colorGradients[type];
		const bar = document.querySelector(`.color-bar:nth-of-type(${type === 'bg' ? '1' : type === 'frame' ? '2' : '3'}) .bar`);
		
		if (colors.length === 1) {
			bar.style.background = colors[0].color;
		} else {
			// グラデーション作成（角度一括管理）
			const gradientStops = colors.map(c => c.color).join(', ');
			bar.style.background = `linear-gradient(${colorAngles[type]}deg, ${gradientStops})`;
		}
		if (type === 'frame') createFrameImage();
		drawFrame();
	}

