	// フレーム画像を作成（枠線の色を反映）
	function createFrameImage() {
		const frameCanvas = document.createElement('canvas');
		frameCanvas.width = 512;
		frameCanvas.height = 512;
		const frameCtx = frameCanvas.getContext('2d');
		
		// 枠線の色を取得
		const frameColors = colorGradients.frame;
		let frameStrokeOuter, frameStrokeInner;
		if (frameColors.length === 1) {
			frameStrokeOuter = frameColors[0].color;
			frameStrokeInner = frameColors[0].color;
		} else {
			// グラデーション（角度一括管理）
			const angle = colorAngles.frame || 0;
			const rad = angle * Math.PI / 180;
			const x0 = 256 - Math.cos(rad) * 240;
			const y0 = 256 - Math.sin(rad) * 240;
			const x1 = 256 + Math.cos(rad) * 240;
			const y1 = 256 + Math.sin(rad) * 240;
			const gradOuter = frameCtx.createLinearGradient(x0, y0, x1, y1);
			frameColors.forEach((c, i) => {
				gradOuter.addColorStop(i/(frameColors.length-1), c.color);
			});
			frameStrokeOuter = gradOuter;

			const x0i = 256 - Math.cos(rad) * 180;
			const y0i = 256 - Math.sin(rad) * 180;
			const x1i = 256 + Math.cos(rad) * 180;
			const y1i = 256 + Math.sin(rad) * 180;
			const gradInner = frameCtx.createLinearGradient(x0i, y0i, x1i, y1i);
			frameColors.forEach((c, i) => {
				gradInner.addColorStop(i/(frameColors.length-1), c.color);
			});
			frameStrokeInner = gradInner;
		}

		// 外円
		frameCtx.beginPath();
		frameCtx.arc(256, 256, 240, 0, Math.PI * 2);
		frameCtx.strokeStyle = frameStrokeOuter;
		frameCtx.lineWidth = 8;
		frameCtx.stroke();

		// 内円
		frameCtx.beginPath();
		frameCtx.arc(256, 256, 180, 0, Math.PI * 2);
		frameCtx.strokeStyle = frameStrokeInner;
		frameCtx.lineWidth = 4;
		frameCtx.stroke();
		
		frameImg.src = frameCanvas.toDataURL();
	}
	
	// 初期フレーム作成
	createFrameImage();
	
	frameImg.onload = function() {
		drawFrame();
	};

	function drawFrame() {
		ctx.clearRect(0, 0, canvas.width, canvas.height);

		// リング部分の背景は常に描画（グラデーション対応）
		const outerR = canvas.width * 0.47;
		const innerR = canvas.width * 0.35;
		ctx.save();
		ctx.beginPath();
		ctx.arc(canvas.width/2, canvas.height/2, outerR, 0, Math.PI*2, false);
		ctx.arc(canvas.width/2, canvas.height/2, innerR, Math.PI*2, 0, true);
		ctx.closePath();
		// グラデーション色取得
		const bgColors = colorGradients.bg;
		let fillStyle = bgColors[0].color;
		if (bgColors.length > 1) {
			// 線形グラデーション（角度一括管理）
			const rad = colorAngles.bg * Math.PI / 180;
			const x0 = canvas.width/2 - Math.cos(rad) * outerR;
			const y0 = canvas.height/2 - Math.sin(rad) * outerR;
			const x1 = canvas.width/2 + Math.cos(rad) * outerR;
			const y1 = canvas.height/2 + Math.sin(rad) * outerR;
			const grad = ctx.createLinearGradient(x0, y0, x1, y1);
			bgColors.forEach((c, i) => {
				grad.addColorStop(i/(bgColors.length-1), c.color);
			});
			fillStyle = grad;
		}
		ctx.fillStyle = fillStyle;
		ctx.fill();
		ctx.restore();

	// 画像データがあればリング部分に描画（指定値に変更）
	// x_px: 1, y_px: 12, w_px: 510, h_px: 482
	// center_norm_box: { x: 0.5, y: 0.494141 }
	// size_norm_box: { w: 0.996094, h: 0.941406 }
	const normCenterX = canvas.width * 0.5;
	const normCenterY = canvas.height * 0.52;
	const normImgW = canvas.width * 0.996094;
	const normImgH = canvas.height * 0.941406;
	const normImgX = normCenterX - normImgW / 2;
	const normImgY = normCenterY - normImgH / 2;

	if (ringImg.src && ringImg.src !== window.location.href) {
		// 枠線のグラデーション情報を取得
		const gradColors = (colorGradients.frame && colorGradients.frame.length > 0) ? colorGradients.frame : [{color:'#fff'}];
		const gradAngle = (typeof colorAngles.frame === 'number') ? colorAngles.frame : 0;
		// ringImgをグラデーション色で変換した一時canvasを作成
		const tempCanvas = document.createElement('canvas');
		tempCanvas.width = ringImg.naturalWidth;
		tempCanvas.height = ringImg.naturalHeight;
		const tempCtx = tempCanvas.getContext('2d');
		tempCtx.drawImage(ringImg, 0, 0);
		// グラデーション配列をRGB配列に変換
		function hexToRgb(hex) {
			hex = hex.replace('#', '');
			if (hex.length === 3) hex = hex.split('').map(x=>x+x).join('');
			const num = parseInt(hex, 16);
			return [num >> 16 & 255, num >> 8 & 255, num & 255];
		}
		// グラデーション方向ベクトル
		const rad = gradAngle * Math.PI / 180;
		const w = tempCanvas.width, h = tempCanvas.height;
		const x0 = w/2 - Math.cos(rad)*w/2, y0 = h/2 - Math.sin(rad)*h/2;
		const x1 = w/2 + Math.cos(rad)*w/2, y1 = h/2 + Math.sin(rad)*h/2;
		// 各ピクセルのグラデーション位置を計算
		const imgData = tempCtx.getImageData(0, 0, w, h);
		const data = imgData.data;
		for (let y = 0; y < h; y++) {
			for (let x = 0; x < w; x++) {
				const i = (y*w + x) * 4;
				if (data[i+3] === 0) continue;
				// グラデーション上の位置（0～1）
				const t = ((x-x0)*(x1-x0)+(y-y0)*(y1-y0))/((x1-x0)**2+(y1-y0)**2);
				// どの2色間かを決定
				let colorIdx = 0;
				let localT = t;
				if (gradColors.length === 1) {
					colorIdx = 0; localT = 0;
				} else {
					const seg = 1/(gradColors.length-1);
					colorIdx = Math.max(0, Math.min(gradColors.length-2, Math.floor(t/(seg+1e-8))));
					localT = (t - seg*colorIdx)/seg;
					localT = Math.max(0, Math.min(1, localT));
				}
				const rgb1 = hexToRgb(gradColors[colorIdx].color);
				const rgb2 = hexToRgb(gradColors[Math.min(colorIdx+1, gradColors.length-1)].color);
				// 線形補間
				const r = rgb1[0] + (rgb2[0]-rgb1[0])*localT;
				const g = rgb1[1] + (rgb2[1]-rgb1[1])*localT;
				const b = rgb1[2] + (rgb2[2]-rgb1[2])*localT;
				// 元の輝度
				const gray = 0.299*data[i] + 0.587*data[i+1] + 0.114*data[i+2];
				data[i] = r * (gray/255);
				data[i+1] = g * (gray/255);
				data[i+2] = b * (gray/255);
			}
		}
		tempCtx.putImageData(imgData, 0, 0);
		ctx.save();
		ctx.beginPath();
		ctx.arc(canvas.width/2, canvas.height/2, outerR, 0, Math.PI*2, false);
		ctx.arc(canvas.width/2, canvas.height/2, innerR, Math.PI*2, 0, true);
		ctx.closePath();
		ctx.clip();
		ctx.drawImage(tempCanvas, normImgX, normImgY, normImgW, normImgH);
		ctx.restore();
	}

		// スイッチの状態取得（中央円の背景描画）
		const centerBgSwitch = document.getElementById('bgSwitch').checked;
		if (centerBgSwitch) {
			ctx.save();
			ctx.beginPath();
			ctx.arc(canvas.width/2, canvas.height/2, innerR, 0, Math.PI*2);
			ctx.closePath();
			// 中央円専用グラデーション生成
			let fillStyle = colorGradients.bg[0].color;
			if (colorGradients.bg.length > 1) {
				const rad = colorAngles.bg * Math.PI / 180;
				const x0 = canvas.width/2 - Math.cos(rad) * innerR;
				const y0 = canvas.height/2 - Math.sin(rad) * innerR;
				const x1 = canvas.width/2 + Math.cos(rad) * innerR;
				const y1 = canvas.height/2 + Math.sin(rad) * innerR;
				const grad = ctx.createLinearGradient(x0, y0, x1, y1);
				colorGradients.bg.forEach((c, i) => {
					grad.addColorStop(i/(colorGradients.bg.length-1), c.color);
				});
				fillStyle = grad;
			}
			ctx.fillStyle = fillStyle;
			ctx.fill();
			ctx.restore();
		}

		// 画像があれば中央に描画（円形にクリップ）
		if (userImg) {
			ctx.save();
			ctx.beginPath();
			ctx.arc(canvas.width/2, canvas.height/2, canvas.width * 0.35, 0, Math.PI * 2);
			ctx.clip();
			const size = canvas.width * 0.7;
			const x = (canvas.width - size) / 2;
			const y = (canvas.height - size) / 2;
			ctx.drawImage(userImg, x, y, size, size);
			ctx.restore();
		}

		// 画像データがあれば中央円部分にユーザー画像の上に描画
		if (ringImg.src && ringImg.src !== window.location.href) {
			// 枠線のグラデーション情報を取得
			const gradColors = (colorGradients.frame && colorGradients.frame.length > 0) ? colorGradients.frame : [{color:'#fff'}];
			const gradAngle = (typeof colorAngles.frame === 'number') ? colorAngles.frame : 0;
			// ringImgをグラデーション色で変換した一時canvasを作成
			const tempCanvas = document.createElement('canvas');
			tempCanvas.width = ringImg.naturalWidth;
			tempCanvas.height = ringImg.naturalHeight;
			const tempCtx = tempCanvas.getContext('2d');
			tempCtx.drawImage(ringImg, 0, 0);
			// グラデーション配列をRGB配列に変換
			function hexToRgb(hex) {
				hex = hex.replace('#', '');
				if (hex.length === 3) hex = hex.split('').map(x=>x+x).join('');
				const num = parseInt(hex, 16);
				return [num >> 16 & 255, num >> 8 & 255, num & 255];
			}
			// グラデーション方向ベクトル
			const rad = gradAngle * Math.PI / 180;
			const w = tempCanvas.width, h = tempCanvas.height;
			const x0 = w/2 - Math.cos(rad)*w/2, y0 = h/2 - Math.sin(rad)*h/2;
			const x1 = w/2 + Math.cos(rad)*w/2, y1 = h/2 + Math.sin(rad)*h/2;
			// 各ピクセルのグラデーション位置を計算
			const imgData = tempCtx.getImageData(0, 0, w, h);
			const data = imgData.data;
			for (let y = 0; y < h; y++) {
				for (let x = 0; x < w; x++) {
					const i = (y*w + x) * 4;
					if (data[i+3] === 0) continue;
					// グラデーション上の位置（0～1）
					const t = ((x-x0)*(x1-x0)+(y-y0)*(y1-y0))/((x1-x0)**2+(y1-y0)**2);
					// どの2色間かを決定
					let colorIdx = 0;
					let localT = t;
					if (gradColors.length === 1) {
						colorIdx = 0; localT = 0;
					} else {
						const seg = 1/(gradColors.length-1);
						colorIdx = Math.max(0, Math.min(gradColors.length-2, Math.floor(t/(seg+1e-8))));
						localT = (t - seg*colorIdx)/seg;
						localT = Math.max(0, Math.min(1, localT));
					}
					const rgb1 = hexToRgb(gradColors[colorIdx].color);
					const rgb2 = hexToRgb(gradColors[Math.min(colorIdx+1, gradColors.length-1)].color);
					// 線形補間
					const r = rgb1[0] + (rgb2[0]-rgb1[0])*localT;
					const g = rgb1[1] + (rgb2[1]-rgb1[1])*localT;
					const b = rgb1[2] + (rgb2[2]-rgb1[2])*localT;
					// 元の輝度
					const gray = 0.299*data[i] + 0.587*data[i+1] + 0.114*data[i+2];
					data[i] = r * (gray/255);
					data[i+1] = g * (gray/255);
					data[i+2] = b * (gray/255);
				}
			}
			tempCtx.putImageData(imgData, 0, 0);
			ctx.save();
			ctx.beginPath();
			ctx.arc(canvas.width/2, canvas.height/2, innerR, 0, Math.PI*2);
			ctx.closePath();
			ctx.clip();
			ctx.drawImage(tempCanvas, normImgX, normImgY, normImgW, normImgH);
			ctx.restore();
		}

		// フレーム画像を上に描画
		ctx.drawImage(frameImg, 0, 0, canvas.width, canvas.height);

		// テキスト描画（リング下部に沿う/複数対応）
		texts.forEach(textObj => {
			if (!textObj.value) return;
			ctx.save();
			ctx.font = `${textObj.weight} ${textObj.size}px ${textObj.font}`;
			
			// 文字の色を設定（グラデーション対応）
			const textColors = colorGradients.text;
			// 文字ごとに色を決定するため、fillStyleはfor文内で設定
			
			const centerX = canvas.width / 2;
			const centerY = canvas.height / 2;
			const radius = canvas.width * 0.41;
			const spacing = textObj.spacing;
			// 文字ごとの幅取得
			let charWidths = [];
			let totalWidth = 0;
			for (let i = 0; i < textObj.value.length; i++) {
				let w = ctx.measureText(textObj.value[i]).width;
				charWidths.push(w);
				totalWidth += w;
			}
			totalWidth += spacing * (textObj.value.length - 1);
			// 文字列全体の角度（度数基準）
			let totalArcDeg = (totalWidth / (radius * Math.PI)) * 180;
			// 開始角度（度数基準）
			let baseAngleDeg = textObj.startAngle;
			if (textObj.northZero) baseAngleDeg -= 90;
			// 中央寄せの場合は、baseAngleDegを中心に文字列全体が配置される
			let angleDeg;
			if (textObj.centerAngle) {
				angleDeg = baseAngleDeg - totalArcDeg / 2;
			} else {
				angleDeg = baseAngleDeg;
			}
			// 反時計回り
			let direction = textObj.ccw ? -1 : 1;
			// 文字描画
			ctx.save();
			// 反時計回りは文字列の並び順のみ逆転
			let chars = textObj.ccw ? [...textObj.value].reverse() : [...textObj.value];
			for (let i = 0; i < chars.length; i++) {
				const char = chars[i];
				const charWidth = charWidths[textObj.ccw ? (chars.length - 1 - i) : i];
				const charArcDeg = (charWidth / (radius * Math.PI)) * 180;
				const theta = (angleDeg + charArcDeg / 2) * Math.PI / 180;
				const x = centerX + radius * Math.cos(theta);
				const y = centerY + radius * Math.sin(theta);
				ctx.save();
				ctx.translate(x, y);
				let rot = theta + Math.PI / 2;
				if (textObj.inward) rot += Math.PI;
				ctx.rotate(rot);
				ctx.textAlign = 'center';
				ctx.textBaseline = 'middle';
				// 文字ごとにグラデーション色を計算
				let color;
				if (textColors.length === 1) {
					color = textColors[0].color;
				} else {
					// 円周上の割合（0～1）
					let ratio = i / (chars.length - 1);
					let idx = Math.floor(ratio * (textColors.length - 1));
					let nextIdx = Math.min(idx + 1, textColors.length - 1);
					let localRatio = (ratio * (textColors.length - 1)) - idx;
					const c1 = textColors[idx].color;
					const c2 = textColors[nextIdx].color;
					color = lerpColor(c1, c2, localRatio);
				}
				ctx.fillStyle = color;
				ctx.fillText(char, 0, 0);
				ctx.restore();
				angleDeg += (charArcDeg + (spacing / (radius * Math.PI)) * 180);
			}
			ctx.restore();
			ctx.restore();

// 色を線形補間する関数（#RRGGBBのみ対応）
function lerpColor(a, b, t) {
	// a, b: '#RRGGBB'  t: 0～1
	const ar = parseInt(a.slice(1,3),16), ag = parseInt(a.slice(3,5),16), ab = parseInt(a.slice(5,7),16);
	const br = parseInt(b.slice(1,3),16), bg = parseInt(b.slice(3,5),16), bb = parseInt(b.slice(5,7),16);
	const rr = Math.round(ar + (br-ar)*t), rg = Math.round(ag + (bg-ag)*t), rb = Math.round(ab + (bb-ab)*t);
	return `#${rr.toString(16).padStart(2,'0')}${rg.toString(16).padStart(2,'0')}${rb.toString(16).padStart(2,'0')}`;
}
		});
	}

	function showCropModal(img) {
		originalImage = img;
			if (!document.getElementById('jpModalAnimStyle')) {
				const style = document.createElement('style');
				style.id = 'jpModalAnimStyle';
				   // style.textContent = ``;
				document.head.appendChild(style);
			}
			cropModal.style.background = 'transparent'; // 背景を暗くしない
			cropModal.style.display = 'flex';
			const inner = cropModal.querySelector('div');
			   // if (inner) inner.classList.add('jp-modal-anim');
		
		// キャンバスサイズを調整
		const maxSize = Math.min(600, window.innerWidth * 0.7, window.innerHeight * 0.6);
		const aspectRatio = img.width / img.height;
		
		if (aspectRatio > 1) {
			cropCanvas.width = maxSize;
			cropCanvas.height = maxSize / aspectRatio;
		} else {
			cropCanvas.width = maxSize * aspectRatio;
			cropCanvas.height = maxSize;
		}
		
		cropOverlay.width = cropCanvas.width;
		cropOverlay.height = cropCanvas.height;
		
	// 初期円の位置とサイズ（最大）
	const minSize = Math.min(cropCanvas.width, cropCanvas.height);
	cropCircle.radius = minSize / 2;
	cropCircle.x = cropCanvas.width / 2;
	cropCircle.y = cropCanvas.height / 2;
		
		updateCropPreview();
	}

	function updateCropPreview() {
		// 元画像を描画
		cropCtx.clearRect(0, 0, cropCanvas.width, cropCanvas.height);
		cropCtx.drawImage(originalImage, 0, 0, cropCanvas.width, cropCanvas.height);
		
		// オーバーレイを描画
		cropOverlayCtx.clearRect(0, 0, cropOverlay.width, cropOverlay.height);
		
		// 半透明の暗いオーバーレイ
		cropOverlayCtx.fillStyle = 'rgba(0, 0, 0, 0.5)';
		cropOverlayCtx.fillRect(0, 0, cropOverlay.width, cropOverlay.height);
		
		// 切り取り円形を透明にする
		cropOverlayCtx.globalCompositeOperation = 'destination-out';
		cropOverlayCtx.beginPath();
		cropOverlayCtx.arc(cropCircle.x, cropCircle.y, cropCircle.radius, 0, Math.PI * 2);
		cropOverlayCtx.fill();
		
	// 円形の枠線を描画（白色・実線）
	cropOverlayCtx.globalCompositeOperation = 'source-over';
	cropOverlayCtx.strokeStyle = '#fff';
	cropOverlayCtx.lineWidth = 2;
	cropOverlayCtx.setLineDash([]);
	cropOverlayCtx.beginPath();
	cropOverlayCtx.arc(cropCircle.x, cropCircle.y, cropCircle.radius, 0, Math.PI * 2);
	cropOverlayCtx.stroke();
		
	// ハンドル描画なし
	// drawHandles(); // Commented out to disable handle drawing
	}

