	function getMousePos(e) {
		const rect = cropCanvas.getBoundingClientRect();
		return {
			x: e.clientX - rect.left,
			y: e.clientY - rect.top
		};
	}

	function startDrag(e) {
		const mousePos = getMousePos(e);
		const distance = Math.sqrt(
			Math.pow(mousePos.x - cropCircle.x, 2) + 
			Math.pow(mousePos.y - cropCircle.y, 2)
		);
		
		if (distance <= cropCircle.radius) {
			isDragging = true;
			dragStart = {
				x: mousePos.x - cropCircle.x,
				y: mousePos.y - cropCircle.y
			};
			cropArea.classList.add('dragging');
			e.preventDefault();
		}
	}

	function startResize(e) {
		isResizing = true;
		activeHandle = parseInt(e.target.dataset.direction);
		dragStart = getMousePos(e);
		e.preventDefault();
		e.stopPropagation();
	}

	function handleMouseMove(e) {
		const mousePos = getMousePos(e);
		
		if (isDragging) {
			// 円を移動
			let newX = mousePos.x - dragStart.x;
			let newY = mousePos.y - dragStart.y;
			
			// 境界制限
			newX = Math.max(cropCircle.radius, Math.min(cropCanvas.width - cropCircle.radius, newX));
			newY = Math.max(cropCircle.radius, Math.min(cropCanvas.height - cropCircle.radius, newY));
			
			cropCircle.x = newX;
			cropCircle.y = newY;
			updateCropPreview();
		} else if (isResizing && activeHandle !== null) {
			// 円のサイズを変更
			const centerX = cropCircle.x;
			const centerY = cropCircle.y;
			const distance = Math.sqrt(
				Math.pow(mousePos.x - centerX, 2) + 
				Math.pow(mousePos.y - centerY, 2)
			);
			
			// 最小・最大サイズ制限
			const minRadius = 50;
			const maxRadius = Math.min(
				cropCanvas.width / 2,
				cropCanvas.height / 2,
				Math.min(centerX, cropCanvas.width - centerX),
				Math.min(centerY, cropCanvas.height - centerY)
			);
			
			cropCircle.radius = Math.max(minRadius, Math.min(maxRadius, distance));
			updateCropPreview();
		}
	}

	function stopDragResize() {
		isDragging = false;
		isResizing = false;
		activeHandle = null;
		cropArea.classList.remove('dragging');
	}

	function cropImage() {
		const diameter = cropCircle.radius * 2;
		
		// 新しいキャンバスを作成
		const croppedCanvas = document.createElement('canvas');
		croppedCanvas.width = diameter;
		croppedCanvas.height = diameter;
		const croppedCtx = croppedCanvas.getContext('2d');
		
		// 円形にクリップ
		croppedCtx.beginPath();
		croppedCtx.arc(cropCircle.radius, cropCircle.radius, cropCircle.radius, 0, Math.PI * 2);
		croppedCtx.clip();
		
		// 元画像の対応部分を描画
		const scaleX = originalImage.width / cropCanvas.width;
		const scaleY = originalImage.height / cropCanvas.height;
		
		const sourceX = (cropCircle.x - cropCircle.radius) * scaleX;
		const sourceY = (cropCircle.y - cropCircle.radius) * scaleY;
		const sourceSize = diameter * Math.min(scaleX, scaleY);
		
		croppedCtx.drawImage(
			originalImage,
			sourceX,
			sourceY,
			sourceSize,
			sourceSize,
			0,
			0,
			diameter,
			diameter
		);
		
		// 切り取った画像を新しいImageオブジェクトに変換
		const croppedImg = new Image();
		croppedImg.onload = function() {
			userImg = croppedImg;
			drawFrame();
			cropModal.style.display = 'none';
		};
		croppedImg.src = croppedCanvas.toDataURL();
	}

