	document.getElementById('imgInput').addEventListener('change', function(e) {
		const file = e.target.files[0];
		if (!file) return;
		const img = new Image();
		img.onload = function() {
			showCropModal(img);
		};
		img.src = URL.createObjectURL(file);
	});

	// 切り取りモーダルのドラッグイベント

	// ドラッグで移動
	cropArea.addEventListener('mousedown', startDrag);
	document.addEventListener('mousemove', handleMouseMove);
	document.addEventListener('mouseup', stopDragResize);

	// マウスホイールで円の大きさを変更
	cropArea.addEventListener('wheel', function(e) {
		e.preventDefault();
		const minRadius = 20;
		const maxRadius = Math.min(cropCanvas.width, cropCanvas.height) / 2;
		let delta = e.deltaY || e.detail || e.wheelDelta;
		// 滑らかに: 1px単位で変化（deltaの符号で判定）
		let newRadius = cropCircle.radius - Math.sign(delta) * 1.5 * Math.abs(delta / 100);
		newRadius = Math.max(minRadius, Math.min(maxRadius, newRadius));
		// はみ出しそうなら中心を逆側に寄せる
		let cx = cropCircle.x;
		let cy = cropCircle.y;
		// 左
		if (cx - newRadius < 0) cx = newRadius;
		// 右
		if (cx + newRadius > cropCanvas.width) cx = cropCanvas.width - newRadius;
		// 上
		if (cy - newRadius < 0) cy = newRadius;
		// 下
		if (cy + newRadius > cropCanvas.height) cy = cropCanvas.height - newRadius;
		cropCircle.radius = newRadius;
		cropCircle.x = cx;
		cropCircle.y = cy;
		updateCropPreview();
	}, { passive: false });

	document.getElementById('cropConfirm').addEventListener('click', cropImage);

	document.getElementById('cropCancel').addEventListener('click', function() {
		cropModal.style.display = 'none';
	});

	// スイッチ変更時に再描画
	document.getElementById('bgSwitch').addEventListener('change', function() {
		drawFrame();
	});

